import React, { useEffect } from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import api, { key } from './services/api';


const ResultList = () => {
    return(
        <ul>
            <li>ksdf</li>
            <li>ksddf</li>
            <li>ksddf</li>
        </ul>
    )
}

const UsernameInput = () => {
    return(
        <input placeholder='dale'/>
    )
}

/////////

const Main = () => {
    const [list, setList] = useEffect(null);

    useEffect(() => {
        async function loadData(){
            let top = await api.get(`?api_key=${key}&method=user.gettopartists&username=rheiselsilva&limit=10&format=json`)
            setList(top);
        }
        loadData();
    })

    return(
        <div>
            <UsernameInput />
            {(list !== null &&
                <ResultList />)
            }
        </div>
    ) 

}

ReactDOM.render(<Main />, document.getElementById('root'))
